import React, { useState } from "react";
const Header = ({parentCallback}) => {

    const [tempType,setTempType]=useState('f');
    const handleChangeTempType = (type)=>{
       if(tempType !== type){
           setTempType(type);
           parentCallback(type);
       }
    }
 return (
      <>
      <span>Instaweather</span>
      <div>
          <span onClick={() => handleChangeTempType('c')}>c</span>
          <span></span>
          <span onClick={() => handleChangeTempType('f')}>f</span>
      </div>
      </>
    );
};
export default Header;
